import { REGISTER, LOGIN } from "../action-types"

export const register = (name, surname, email, password) => {
    return {
        type: REGISTER,
        payload: { name, surname, email, password}
    }
}

export const login = (email, password) => {
    return {
        type: LOGIN,
        payload: {email, password}
    }
}
